import React from 'react';

class ComparePage extends React.Component {
   constructor() {
     super()
     this.state = {}
   }

   render() {
     return (
       <div>
         <h1>Its a battle betweem two movies!</h1>
         <h2>Which one will come out on top?</h2>
       </div>
     )
   }
}

export default ComparePage;
